Sophie Howard (born 24 February 1983) is a former English glamour model from Southport, England.[1][2] She appeared regularly on Page Three and in men's magazines, such as Maxim, Nuts, and Loaded. In August 2005, Howard was voted 73rd in the FHM UK &quot;100 Sexiest Women&quot; poll. In the 2006 poll, she rose to 68th place.[3]
